import React from "react";
import { Link } from "react-router-dom";
import AuthButtons from "./AuthButtons"; // Import the new AuthButtons component
import "./Navbar.css"; // Ensure CSS styles are updated

const Navbar = ({ isLoggedIn, handleLogout }) => {
  return (
    <nav className="navbar">
      <h1 className="logo">Live Dental Office Availability</h1>
      <div className="nav-right">
        {isLoggedIn ? (
          <button className="logout-btn" onClick={handleLogout}>
            Logout
          </button>
        ) : (
          <AuthButtons /> // Show login/signup buttons if not logged in
        )}
      </div>
    </nav>
  );
};

export default Navbar;
